  NSString *acnt = @"tkjohn@blah.im";
  NSString *pswd = @"12345678";
  NSString *host = @"jabber.blah.im";
  NSString *port = @"5222";
  [[ABEngine sharedObject] setServer:host];
  [[ABEngine sharedObject] setPort:port];
